import React from 'react';

const ProductItem = ({ product }) => {

    return (
        <div>
            <h4>{product.name}</h4>
            <img style={{ width: 200, height: auto }} src={product.imgUrl} alt="" />
            <p>{product.description}</p>
            <h6>{product.price}</h6>
        </div>
    );
}

export default ProductItem;
